import React, { useState, useEffect } from 'react';
import axios from 'axios';
import VehicleList from './VehicleList';

function AdminDashboard() {
  const [users, setUsers] = useState([]);  // Initial state as an empty array
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    // Fetch users and vehicles
    const fetchUsersAndVehicles = async () => {
      try {
        const usersResponse = await axios.get('http://localhost:5000/api/users');
        console.log('Users Response:', usersResponse.data);  // Log the response to inspect it
        
        // Correctly access the 'users' array from the response
        if (Array.isArray(usersResponse.data.users)) {
          setUsers(usersResponse.data.users);  // Set users from the 'users' key in the response
        } else {
          console.error('The users data is not an array');
          setUsers([]);  // Fallback to an empty array if it's not an array
        }

        const vehiclesResponse = await axios.get('http://localhost:5000/api/vehicles');
        console.log("Received vehicles:", vehiclesResponse.data);  // Log the vehicles prop


        if (Array.isArray(vehiclesResponse.data.vehicles)) {
          setvehicles(vehiclesResponse.data.vehicles);  // Set vehicles from the 'vehicles' key in the response
        } else {
          console.error('The vehicles data is not an array');
          setVehicles([]);  // Fallback to an empty array if it's not an array
        }

      } catch (error) {
        console.error('Error fetching data', error);
      }
    };

    fetchUsersAndVehicles();
  }, []);

  return (
    <div>
      <h1>Admin Dashboard</h1>

      <h2>Users</h2>
      {Array.isArray(users) && users.length > 0 ? (
        <ul>
          {users.map((user) => (
            <li key={user._id}>{user.name} - {user.email}</li>
          ))}
        </ul>
      ) : (
        <p>No users found</p>
      )}

      <VehicleList vehicles={vehicles} />
    </div>
  );
}

export default AdminDashboard;
